import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';
import ProductList from './components/ProductList';
import ProductDetail from './components/ProductDetail';
import Cart from './components/Cart';
import OrderForm from './components/OrderForm';
import OrderHistory from './components/OrderHistory';
import AdminProductList from './components/AdminProductList';
import CreateProductForm from './components/CreateProductForm';
import UpdateProductForm from './components/UpdateProductForm';
import CustomerList from './components/CustomerList';
import CreateCustomerForm from './components/CreateCustomerForm';
import UpdateCustomerForm from './components/UpdateCustomerForm';
import './App.css';

const App = () => {
    const [cartItems, setCartItems] = useState([]);
    const [orders, setOrders] = useState([]);
    const [customers, setCustomers] = useState([]);

    const addToCart = (product, quantity) => {
        const exist = cartItems.find(item => item.id === product.id);
        if (exist) {
            setCartItems(
                cartItems.map(item =>
                    item.id === product.id ? { ...exist, quantity: exist.quantity + parseInt(quantity) } : item
                )
            );
        } else {
            setCartItems([...cartItems, { ...product, quantity: parseInt(quantity) }]);
        }
    };

    const removeFromCart = (id) => {
        setCartItems(cartItems.filter(item => item.id !== id));
    };

    const createOrder = (order) => {
        setOrders([...orders, { ...order, id: Date.now(), status: 'Pending', date: new Date() }]);
        setCartItems([]);
    };

    const cancelOrder = (id) => {
        setOrders(orders.map(order => order.id === id ? { ...order, status: 'Cancelled' } : order));
    };

    const createCustomer = (customer) => {
        setCustomers([...customers, { ...customer, id: Date.now() }]);
    };

    const updateCustomer = (id, updatedCustomer) => {
        setCustomers(customers.map(customer => customer.id === id ? updatedCustomer : customer));
    };

    return (
        <Router>
            <Header />
            <main className="py-3">
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/products" element={<ProductList addToCart={addToCart} />} />
                    <Route path="/product/:id" element={<ProductDetail addToCart={addToCart} />} />
                    <Route path="/cart" element={<Cart cartItems={cartItems} removeFromCart={removeFromCart} />} />
                    <Route path="/checkout" element={<OrderForm cartItems={cartItems} createOrder={createOrder} />} />
                    <Route path="/order-history" element={<OrderHistory orders={orders} cancelOrder={cancelOrder} />} />
                    <Route path="/admin-products" element={<AdminProductList />} />
                    <Route path="/create-product" element={<CreateProductForm />} />
                    <Route path="/update-product/:id" element={<UpdateProductForm />} />
                    <Route path="/create-customer" element={<CreateCustomerForm createCustomer={createCustomer} />} />
                    <Route path="/customer-list" element={<CustomerList customers={customers} />} />
                    <Route path="/update-customer/:id" element={<UpdateCustomerForm customers={customers} updateCustomer={updateCustomer} />} />
                </Routes>
            </main>
            <Footer />
        </Router>
    );
};

export default App;
